import { Link } from "react-router-dom";
import db from "../Database";
import "../index.css"
import KanbasNavigation from "../KanbasNavigation";
import CourseNavigation from "../Courses/CourseNavigation";
function Dashboard() {
    const courses = db.courses;
    return (
        <div className="table-borderless table-responsive">
        <table className="table" border="0" width="100">
            <tbody>
            <tr>
                <td valign="top" width="10%">
                    <KanbasNavigation/>
                </td>
            <td valign="top">
            <h1>Dashboard</h1>
            <div className="list-group">
                {courses.map((course) => (
                    <Link key={course.id} to={`/Kanbas/Courses/${course.id}`}
                          className="card wd-dashboard-padding">
                        <img className="card-img-top" src="../../blue.jpeg"
                             width={"200"} height={"200"}></img>
                        <div className="card-body"> {course.name} </div>
                    </Link>
                ))}
            </div>
            </td>
            </tr>
            </tbody>
        </table>
        </div>
    );
}
export default Dashboard;
